import React from 'react';
import './navbar.css'
import logo from './LogoSample_ByTailorBrands(11)(1).png'

function Navbar (props){

    return(
        <div>
        <div className="logoHome" onClick={props.onClick} ><img src={logo} className="logo"alt="logo"/></div>
        <div className="menu" onClick={props.onClick} >SOBRE MI</div>
        <div className="menu" onClick={props.onClick} ><span>PROYECTOS</span></div>
        {/* <div className="logoHabilities" onClick={props.onClick} ><span>HABILIDADES</span></div>
        <div className="logoContact" onClick={props.onClick} ><span>CONTACTO</span></div> */} */}
        </div>
    )

}

export default Navbar
